import React from 'react';
import { BrowserRouter } from 'react-router-dom';
import './App.css';
import NavBar from './navBar/NavBar.js';
import styles from './cssPage/potfolio.module.css';
import Container from 'react-bootstrap/Container';
function App() {
  return (
    <BrowserRouter>
      <div className={styles.tagline} style={{position:"relative", }}>
        <img className="bgPic" src={'/image/bgImg.jpg'} alt="" />

        <div style={{position:"absolute", top:20, left:""}}>
          <NavBar />
        </div>
      </div>
    </BrowserRouter>
  );
}

export default App;
